import React from "react";
import { NavLink } from "react-router-dom";

const NavBar = () => {
  return (
    <div
      style={{
        border: "2px solid black",
        backgroundColor: "black",
        color: "white",
      }}
    >
      <ul
        style={{
          display: "flex",
          flexDirection: "row",
          justifyContent: "space-around",
          alignItems: "center",
        }}
      >
        <NavLink
          to="/"
          style={{
            textDecoration: "none",
            listStyle: "none",
            color: "white",
          }}
          activeStyle={{
            color: "orange",
          }}
        >
          <li>Home</li>
        </NavLink>
        <NavLink
          to="/login"
          style={{
            textDecoration: "none",
            listStyle: "none",
            color: "white",
          }}
          activeStyle={{
            color: "orange",
          }}
        >
          <li>Login</li>
        </NavLink>
        <NavLink
          to="/register"
          style={{
            textDecoration: "none",
            listStyle: "none",
            color: "white",
          }}
          activeStyle={{
            color: "orange",
          }}
        >
          <li>Register</li>
        </NavLink>
        <NavLink
          to="/attendance"
          style={{
            textDecoration: "none",
            listStyle: "none",
            color: "white",
          }}
          activeStyle={{
            color: "orange",
          }}
        >
          <li>Take Attendance</li>
        </NavLink>
        <NavLink
          to="/"
          style={{
            textDecoration: "none",
            listStyle: "none",
            color: "white",
          }}
        >
          <li>Get Information</li>
        </NavLink>
      </ul>
    </div>
  );
};

export default NavBar;
